import { Container, Stack, Typography } from "@mui/material";

export default function WebsiteBand() {
  return (
    <Container
      maxWidth="fluid"
      sx={{ border: "1px solid #cca2d7", backgroundColor: "transparent" }}
    >
      <Stack
        direction="row"
        justifyContent="space-between"
        spacing={1}
        mt={5}
        mb={5}
      >
        <Typography
          variant="h4"
          fontWeight="bold"
          sx={{
            WebkitTextStroke: 1,
            WebkitTextStrokeColor: "black",
            color: "transparent",
          }}
        >
          # Front-End Developer
        </Typography>
        <Typography variant="h4" fontWeight="bold">
          # Web Designer
        </Typography>
        <Typography
          variant="h4"
          fontWeight="bold"
          sx={{
            WebkitTextStroke: 1,
            WebkitTextStrokeColor: "black",
            color: "transparent",
          }}
        >
          # Full Stack Developer
        </Typography>
        <Typography variant="h4" fontWeight="bold">
          # React Developer
        </Typography>
        <Typography
          variant="h4"
          fontWeight="bold"
          sx={{
            WebkitTextStroke: 1,
            WebkitTextStrokeColor: "black",
            color: "transparent",
          }}
        >
          # .Net Developer
        </Typography>
      </Stack>
    </Container>
  );
}
